import React from "react";
import styled from "styled-components";

const BaseStyled = styled.div`
  border-top: 1px solid #000;
  border-bottom: 1px solid #000;
`;

const Base = () => {
  return <BaseStyled></BaseStyled>;
};

export default Base;
